import React from "react"
import Paper from '@material-ui/core/Paper';

function EduItem (props){
    return(
        <div>
            <Paper>
                <p>Institute: {props.item.Institute}
                <br/>
                Start Year: {props.item.StartYear}
                <br/>
                End Year: {props.item.EndYear}</p>
            </Paper>
        </div>
    )
}

export default EduItem;
